import React, {useState} from "react";
import Main from "./components/Main";
import Header from "./components/Header";

function App() {

  const [CartActive, setCartActive] = useState(false);

  return (
    <React.Fragment>
      <Header cartActive={CartActive} setCartActive={setCartActive}></Header>
      <Main cartActive={CartActive} setCartActive={setCartActive}></Main>
    </React.Fragment>
  );
}

export default App;
